import { useEffect } from "react";
import { Route, useHistory, Switch } from "react-router";
import { CssBaseline, Grid } from "@material-ui/core";
import axios from "axios";

// components
import Sidebar from "../components/Sidebar/Sidebar";
import MainContent from "../components/Content/MainContent";
// styles
import useStyles from "./DashbaordStyles";
import Navbar from "../components/Navbar/Navbar";
import Client from "../components/Content/Client/Client";
import Branch from "../components/Content/Branch/Branch";
import ContactPerson from "../components/Content/ContactPerson/ContactPerson";
import Contract from "../components/Content/Contract/Contract";
import Count from "../components/Content/Count";
import Profile from "../components/Content/Profile/Profile";

const Dashboard = () => {
  const classes = useStyles();
  const history = useHistory();

  const [anchor, setAnchor] = useState(true);

  useEffect(() => {
    axios
      .get("/auth/refreshtoken")
      .then((response) => {})
      .catch((err) => history.push("/"));
  }, [history]);

  return (
    <Grid container className={classes.grid}>
      <CssBaseline />

      <Grid item xs={2}>
        <Sidebar anchor={anchor} setAnchor={setAnchor} />
      </Grid>

      <Grid item xs={10}>
        {/* <MainContent /> */}

        <Navbar />

        <Switch>
          <Route path="/client">
            <Client />
          </Route>
          <Route path="/branch">
            <Branch />
          </Route>
          <Route path="/contactPerson">
            <ContactPerson />
          </Route>
          <Route path="/contract">
            <Contract />
          </Route>
          <Route path="/profile">
            <Profile />
          </Route>
          <Route path="/">
            <Count />
          </Route>
        </Switch>
      </Grid>
    </Grid>
  );
};

export default Dashboard;
